create table pedido (
	codpedido INT PRIMARY KEY,
	dt_pedido DATE,
	hora_pedido VARCHAR(50),
	qtd INT,
	desconto VARCHAR(2),
	cod_cliente INT,
	cod_entregador INT,
	cod_avaliacao INT,
	cod_pizza INT,
	FOREIGN KEY (cod_cliente) REFERENCES cliente(cod_cliente),
	FOREIGN KEY (cod_entregador) REFERENCES entregador(cod_entregador),
	FOREIGN KEY (cod_avaliacao) REFERENCES avaliacao(cod_avaliacao),
	FOREIGN KEY (cod_pizza) REFERENCES pizza(cod_pizza)
	);
	





